window.ImageInput = class ImageInput {
    
    constructor() {
        
        this.error = null;   
        this.fileInput = null; 
        this._formHandler = null;
        this.errorClasses = 'error-msg';
        this.defaultImagePreview = config('form.imagePreview');
    }

    
    init() {
        this.imageSrc = this.inputs.getProp('src') || this.defaultImagePreview;
        this.imageTitle = trans('select-image');
        this.onChange = this.inputs.getEvent('change');
    } 

    
    getImageTitle() {
        return this.getOption('title') || this.imageTitle;
    }

    
    getOption(key) {
        return this.inputs.getOption(key);
    }

    
    validate() {
        if (this.inputs.getOption('required') !== null && Is.empty(this.fileInput.files) && this.imageSrc == this.defaultImagePreview) {
            this._formHandler.addError(this.getOption('name'), 'required', trans('validation.required'));
            this.error = trans('validation.required');            
        } else {
            this.removeError();
        }
    }

    
    removeError() {
        this.error = null;
        this._formHandler.removeError(this.getOption('name'));
    }

    
    ready() {
        this.fileInput.addEventListener('change', e => {
            if (this.fileInput.files && this.fileInput.files[0]) {
                let file = this.fileInput.files[0],
                    reader = new FileReader();

                reader.onload = e => {
                    this.imageSrc = e.target.result;
                    this.imageTitle = file.name;
                    this.onChange({
                        file,
                        fileName: file.name,
                        files: this.fileInput.files,
                        event: e,
                        target: e.target,
                        src: this.imageSrc
                    });
                }

                reader.readAsDataURL(file);
            }
        });

        this._formHandler = this.fileInput.form.formHandler;
    }

    
    reset() {
        this.fileInput.value = '';

        this.imageSrc = this.defaultImagePreview; 
    }

    
    selectImage() {
        this.fileInput.click();
    }

    
    getName() {
        return this.name || Object.get(this.inputs, 'attrs.name');
    }
};
