window.FlkAlert = class FlkAlert {
    
    constructor() {
        if (Is.undefined(window.popups)) {
            window.popups = [];
        }
    }
    
    
    init() {
        this.display = true;
        this.id = this.inputs.getOption('id', Random.id());
        this.inputValue = this.inputs.getOption('value', '');
        this.type = this.inputs.getOption('type', trans('confirm'));
        this.withInput = this.inputs.getProp('withInput', false);
        this.isRequired = this.inputs.getProp('required', false);

        this.confirmBtn = this.inputs.getOption('confirmBtn', this.trans('ok', 'OK'));
        this.closeBtn = this.inputs.getOption('closeBtn', this.trans('cancel', 'Cancel'));
        this.message = this.inputs.getOption('message', this.trans('message', 'Are you sure?'));
        this.inputPlaceholder = this.inputs.getOption('placeholder', '');
        this.heading = this.inputs.getOption('heading', this.trans('heading', 'A confirm message'));
        this.headingTheme = this.inputs.getOption('headingTheme', 'danger');

        this.addPopup();
    }

    addPopup() {
        window.popups.push(this.id);
    }

    
    trans(key, defaultTranslation) {
        let translation = trans(`alert.${key}`);

        return translation == `alert.${key}` ? defaultTranslation : translation;
    }

    
    close() {
        this.display = false;
        this.inputs.getEvent('close')();

        for (let i = 0; i < window.popups.length; i++) {
            let popoupId = window.popups[i];

            if (popoupId == this.id) {
                delete window.popups[i];
            }
        }

        window.popups = Array.reset(window.popups);
    }

    
    confirm() {
        if (this.isRequired && this.inputValue.trim().length  == 0) {
            return this.errorMsg = true;
        }

        this.inputs.getEvent('confirm')(this.inputValue);

        this.close();
    }
};
