window.TaskChecklist = class TaskChecklist {
    
    constructor(taskChecklistsService, taskChecklistItemsService) {    
        this.taskChecklistsService = taskChecklistsService;    
        this.taskChecklistItemsService = taskChecklistItemsService;    
    }
    
    
    init() {
        this.isValidForm = true;
        this.addChecklistForm = false;
        this.task = this.inputs.getProp('task');
    }

    addNewChecklist() {
        this.addChecklistForm = true;

        this.isValidForm = true;

        this.items = [];

        this.items.push('');

        this.checklistName = `Checklist ${this.task.checklists.length + 1}`;
    }

    async submitChecklist(form) {
        this.isSending = true;
        if (this.currentItem) {
            let {record: checklist} = await this.taskChecklistsService.update(this.currentItem.id, form);

            this.task.checklists[this.index] = checklist;

            this.currentItem = false;

            this.isInEditMode = false;
        } else {
            let {record: checklist} = await this.taskChecklistsService.create(form);

            this.task.checklists.push(checklist);    
        }

        this.isSending = false;
        this.addChecklistForm = false;
    }

    suggestCheckItemModification(item) {
        this.modifyingChecklistItem = item;

        this.isSuggestingItemControl = true;
    }
    
    unsuggestCheckItemModification() {
        this.modifyingChecklistItem = null;

        this.isSuggestingItemControl = false;
    }

    changeItemStatus(item, done) {
        item.done = done;
        this.taskChecklistItemsService.changeStatus(item.id, Number(done));
    }

    addChecklistItem(checklist, index) {
        this.currentChecklist = checklist;

        this.currentChecklistIndex = index;

        this.isAddingChecklistItem = true;
    }

    async submitItem(form) {
        this.isSending = true;
        let {record: item} = await this.taskChecklistItemsService.create(form);

        this.currentChecklist.items.push(item);

        this.isSending = false;
        this.isAddingChecklistItem = false;

        
    }

    allowEditing(checklist, index, type) {
        this.currentItem = checklist;
        this.index = index;
        this.type = type;
        this.isInEditMode = true;
    }

    confirmRemoving(checklist, index, type, checklistItem = null, checklistItemIndex = null) {
        this.currentItem = checklist;
        this.index = index;
        this.type = type;
        this.checklistItem = checklistItem;
        this.checklistItemIndex = checklistItemIndex;
        this.isAboutToRemove = true;
    }

    
    remove() {
        if (this.type == 'checklist') {
            this.taskChecklistsService.delete(this.currentItem.id);

            delete this.task.checklists[this.index];

            this.task.checklists = Array.reset(this.task.checklists);
        } else {
            this.taskChecklistItemsService.delete(this.checklistItem.id);

            
            delete this.currentItem.items[this.checklistItemIndex];

            this.currentItem.items = Array.reset(this.currentItem.items)

            
        }
    }
};
window.TaskDetailsPage = class TaskDetailsPage {
    
    constructor(user, cache, router, shareable, tasksService) {
        this.user = user;
        this.cache = cache;
        this.router = router;
        this.shareable = shareable;
        this.tasksService = tasksService;
        this.name = 'task-details';
        this.title = 'Task';
    }

    
    async init() {
        this.isValidForm = true;
        this.task = null;

        this.changeable = true;

        this.taskId = this.router.params.taskId;

        this.cacheKey = `task.${this.taskId}`;

        
        
        

        let { record } = await this.tasksService.get(this.taskId);

        this.setTask(record);

        
    }

    participantCanChangeTaskStatus() {
        return ['notStarted', 'inReview', 'inProgress'].includes(this.task.status);
    }

    getAllowedTaskStatuses() {
        if (this.isSupervisor() || this.task.project && this.task.project.is.higherAuthority) {
            
            let statusesList = [];

            for (let status of TASK_STATUSES) {
                if (status == 'autoFailed') continue;

                statusesList.push(status);
            }

            return statusesList;
        }

        if (this.isParticipant()) {
            if (this.task.status == 'notStarted') {
                return ['inProgress'];
            } else if (this.task.status == 'inProgress') {
                return ['inReview'];
            } else if (this.task.status == 'inReview') {
                return ['inProgress'];
            }
        }
    }

    setTask(task) {
        this.disableAutoDetection();
        this.task = task;

        this.title = this.task.title;

        if (!this.isParticipant() && !this.isSupervisor() && ! this.isProjectMember()) {
            return this.router.navigateTo('/tasks');
        }

        this.task.canBeModified = this.isParticipant() || this.isSupervisor() || this.isProjectHigherAuthorityMember();

        
        if (this.task.project && this.task.project.id) {
            this.shareable.share('project', this.task.project);
        }

        this.detectChanges();
    }

    isProjectMember() {
        return this.task.project && this.task.project.is.member;
    }
    
    isProjectHigherAuthorityMember() {
        return this.task.project && this.task.project.is.higherAuthority;
    }

    async updateTaskStatus(newStatus) {
        if (confirm(`Are you sure you want to change task status to ${newStatus}`) === false) return;

        this.task.status = newStatus;

        this.changeable = false;

        let response = await this.tasksService.updateTaskStatus(this.task.id, newStatus);
        this.task = response.task;

        this.changeable = true;
        
        
    }

    taskStatusCanBeChanged() {
        return (this.isSupervisor() ||
            (this.isParticipant() && this.participantCanChangeTaskStatus()) ||
            (this.task.project && this.task.project.is.higherAuthority)) &&
            this.changeable;
    }

    getTaskStatus() {
        return taskStatus(this.task);
    }

    isParticipant(user = this.user) {
        return this.task.participant.id == user.id;
    }

    isSupervisor(user = this.user) {
        return Array.get(this.task.supervisors, supervisor => supervisor.id == user.id) !== null;
    }

    async submit(form) {
        if (confirm('Are you sure? you can not undo this action') === false) return;

        this.isSending = true;

        if (this.recordData) {
            let formData = new FormData(form);
            formData.append('record', this.recordData);
            form = formData;
        }

        let response = await this.tasksService.submitTask(this.task.id, form);

        this.task = response.task;
        
        this.detectChanges();
    }

    async submitComment(form) {
        this.isSending = true;

        if (this.recordData) {
            let formData = new FormData(form);
            formData.append('record', this.recordData);
            form = formData;
        }

        let response = await this.tasksService.addNewComment(this.task.id, form);

        this.isSent = true;

        this.isSending = false;

        this.recordSrc = null;

        this.recordData = false;

        this.task = response.task;

        setTimeout(() => {
            this.isSent = false;
        }, 100);
    }

    
    captureRecord(record) {
        this.recordSrc = record.url;
        this.recordData = record.blob;
    }

    
    clearRecord(withConfirm = false) {
        if (withConfirm && confirm('Are you sure?') === false) return;

        this.recordSrc = null;
        this.recordData = null;
    }
};
