Macros.create('loadModules', function () {
    return new Promise(resolve => {
        if (this.modules) {
            resolve({
                records: this.modules,
            });
        }

        if (!this.projectModulesService) {
            this.projectModulesService = DI.resolve('projectModulesService');
        }

        this.projectModulesService.list({
            project: this.project.id,
        }).then(response => {
            this.modules = response.records.map(projectModule => {
                let text = projectModule.name;

                if (projectModule.parent.id) {
                    text = projectModule.parent.name + ' » ' + text;
                }

                return {
                    text,
                    value: projectModule.id,
                };
            });

            resolve({
                records: this.modules
            });
        })
    });
});;
function loadProjectTasks () {
    return new Promise(resolve => {
        if (! this.project) {
            this.project = {};
        }

        if (this.project.tasks) {
            resolve({
                records: this.project.tasks
            });
        }

        if (! this.tasksService) {
            this.tasksService = DI.resolve('tasksService');
        }

        this.tasksService.list({
            project: this.project.id,
        }).then(response => {
            this.project.tasks = response.records;

            resolve(response);
        })
    });
}

Macros.create('loadProjectTasks', loadProjectTasks);;
Macros.create('loadSprints', function () {
    return new Promise(resolve => {
        if (this.sprints) {
            resolve(this.sprints);
        }

        if (! this.projectSprintsService) {
            this.projectSprintsService = DI.resolve('projectSprintsService');
        }

        this.projectSprintsService.list({
            project: this.project.id,
        }).then(response => {
            this.sprints = response;

            resolve(response);
        })
    });
});;
function loadUserStories (withNoTaskAttached = false, except = null) {    
    return new Promise(resolve => {
        const adjustResponse = response => {
            if (withNoTaskAttached) {
                response.records = response.records.filter(userStory => {
                    return ! userStory.task || ! userStory.task.id || (except && userStory.id == except)
                });
            }
            resolve(response);
        };
    
        if (this.userStories) {
            adjustResponse(this.userStories);
        }

        if (! this.projectUserStoriesService) {
            this.projectUserStoriesService = DI.resolve('projectUserStoriesService');
        }

        this.projectUserStoriesService.list({
            project: this.project.id,
        }).then(response => {
            this.userStories = response;

            adjustResponse(response);
        });
    });
}

